import React, { useState } from "react";
import { StatusCodes } from 'http-status-codes';
import "../styles/login.css"
import Signup from "../components/signup";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

async function loginFamily(password) {

    const requestOptions = {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({ "password": password })
    };

    let result = await fetch("/login", requestOptions)
        .then(response => { return response; })
        .catch(_ => {
            result.status = StatusCodes.SERVICE_UNAVAILABLE;
            return result; });

    if (result.status === StatusCodes.OK){
        return result.json();
    }
    else{
        return result.status;
    }
}

export default function Rsvp() {

    const PASSWORD_LENGTH = 6;
    let sanitizer = require("string-sanitizer");

    const [isDisabled, setIsDisabled] = useState(false);
    const [errorMessage, setErrorMessage] = useState("");

    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [family, setFamily] = useState({});

    const notify = () => 
    toast.success('ðŸ¦„ DziÄ™kujemy za przesÅ‚anie preferencji!', 
    {
        position: "bottom-right",
        autoClose: 2000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
        theme: "light",
    });;

    

    function handleFamilyUpdate() {
        setIsLoggedIn(false);
        notify();
      }

    async function handleSubmit(event) {
        event.preventDefault();

        setIsDisabled(true);
        var password = document.getElementById("loginPassword").value;

        if (password.length !== PASSWORD_LENGTH) {
            setErrorMessage("hasÅ‚o ma dokÅ‚adnie 6 znakÃ³w.");
            setIsDisabled(false);
            return;
        }

        let sanitized_password = sanitizer.sanitize.keepNumber(password);

        let family = await loginFamily(sanitized_password);

        if (family === StatusCodes.NOT_FOUND) {
            setErrorMessage("nie znaleziono rodziny dla podanego hasÅ‚a.");
            setIsDisabled(false);
        }
        if (family === StatusCodes.UNAUTHORIZED) {
            setErrorMessage("nieprawidÅ‚owe hasÅ‚o.");
            setIsDisabled(false);
        }
        else if (family === StatusCodes.BAD_REQUEST ||
            family === StatusCodes.SERVICE_UNAVAILABLE ||
            family === StatusCodes.GATEWAY_TIMEOUT) {
            // jeÅ›li dwie rodziny majÄ… to samo hasÅ‚o - wywala
            setErrorMessage("przepraszamy, wystÄ…piÅ‚ bÅ‚Ä…d serwera.");
            setIsDisabled(false);
        }
        else if (family !== undefined && "members" in family) {
            setErrorMessage("");
            setIsDisabled(false);

            setIsLoggedIn(true);
            setFamily(family);
        }

        family = {
            "id": 22,
            "name": "Kowalscy",
            "members": [
              {
                "id": 1,
                "name": "Jan Kowalski",
                "has_confirmed": true,
                "diet": "podstawowa"
              },
              {
                "id": 2,
                "name": "Maria Kowalska",
                "has_confirmed": false,
                "diet": "wegetariaÅ„ska"
              }
            ],
            "needs_accomodation": true
        }; 

        setIsLoggedIn(true);
        setFamily(family);
    }

    return (
        <section className="login section" id="login">
            <h2 className="section-title">RSVP</h2>
            <span className="section-subtitle">Powiadom nas</span>
            {isLoggedIn ? 
            <>
                <Signup
                    family={family}
                    onFamilyUpdate={handleFamilyUpdate}
                />
            </>
            : 
            <>
                <div className="login__container container">
                    <form className="login__form" onSubmit={handleSubmit} method="POST">
                        <label htmlFor="password"><p className="login__description">Podaj hasÅ‚o z zaproszenia</p></label>
                        <input className="login__form-input" type={"password"} id="loginPassword" name="password" maxLength={PASSWORD_LENGTH}></input>
                        {(!errorMessage !== "") ? <span style={{ color: "red" }} ><div className="login__form-error">{errorMessage}</div></span> : <></>}
                        <input className="button button--flex" type="submit" value="Zaloguj siÄ™" disabled={isDisabled}></input>
                    </form>
                </div>
            </>}
            <ToastContainer
                position="bottom-right"
                autoClose={2000}
                hideProgressBar={false}
                newestOnTop={false}
                closeOnClick
                rtl={false}
                pauseOnFocusLoss
                draggable
                pauseOnHover
                theme="light"
            />
        </section>
    )
}
